pragma solidity ^ 0.4.25;

import './Interfaces.sol';
import './Helpers.sol';
import './Enums.sol';

import "./WildaloERC721.sol";

import './Libs.sol';

contract Wildalo is IWildalo, WildaloERC721,
    UsingAuction,
    UsingCardPackage,
    UsingCardBase,
    UsingCard,
    UsingRepository,
    UsingSettings,
    UsingEnums {

    using SafeMath for uint256;
    using CardByteModifier for uint256;

    uint MAX_BID_CUT_OF_PERCENT = 2000; //%20
    uint MAX_FODR_CUT_OF_PERCENT = 2000; //%20
    uint MAX_FODR_BURN_ON_UPDATE = 1000000000000000;

    function mintFodr(address _to, uint _amount) __onlySystemUser public {
        Repository.mintFodr(_to, _amount);
        emit MintFodr(_to, _amount);
    }

    function transferFunds(address _to, uint256 _requestId, uint _amount, uint256 _currency) __onlySystemUser public {
        require(Repository.isExistsCurrency(_currency));
        if (_currency == uint256(CurrencyType.FODR)) {
            Repository.mintFodr(_to, _amount);
        } else if (_currency == uint256(CurrencyType.WARC)) {
            Repository.withdrawToken(_to, _currency, _amount);
        }
        emit TransferFunds(_to, _requestId, _amount, _currency);
    }

    function createCardBase(uint256 _metedata) __onlySystemUser public {
        CardBase.createCardBase(_metedata);
        emit CreateCardBase(_metedata);
    }

    function mintCardWithBaseId(address _to, uint256 _baseId) __onlySystemUser public {
        uint256 cardId; 
        uint256 metadata; 
        (cardId, metadata) = Card.mintCardWithBaseId( _to, _baseId);
        emit MintCardWithBaseId(_to, cardId, metadata);
    }

    function upgradeCard(uint256 _cardId, uint256 _burnedCardId) __notPaused public {
        uint256 fodrsForBurn = Settings.getFodrBurningCountOnUpdate();

        uint256 metatada = Card.upgradeCard(_cardId, _burnedCardId);
        require(fodrsForBurn <= MAX_FODR_BURN_ON_UPDATE);

        super._burn(_burnedCardId);
        Repository.burnFodr(msg.sender, fodrsForBurn);
        emit UpgradeCard(msg.sender, _cardId, _burnedCardId, metatada);
    }

    function getPackagePrice(uint256 _packageType, uint256 _currencyType) public view returns(uint256) {
        return CardPackage.getPrice(_packageType, _currencyType);
    }

    function buyPackage(uint256 _packageType, uint256 _currency) __notPaused public payable {

        require(Repository.isExistsCurrency(_currency));

        (uint256 price, uint256 packageId) = CardPackage.createPackage(msg.sender, _packageType, _currency);

        if(_currency == uint256(CurrencyType.AVAX)) {
            require (price <= msg.value);
            //deposit avax
            require(address(Repository).call.value(price)());
            //its ok. in this scope "value - budget" never be negative.
            //msg.sender.transfer(msg.value - _budget);
            if(price < msg.value) {
                require(msg.sender.call.value(msg.value - price)());
            }
        } else if (_currency == uint256(CurrencyType.FODR)) {

            Repository.depositToken(msg.sender, _currency, price);
            msg.sender.transfer(msg.value);
        }
        emit BuyPackage(msg.sender, packageId, _packageType, _currency, price);
    }

    function createAuction(uint256 _currency, uint256 _cardId, uint256 _startPrice, uint256 _endPrice, uint256 _duration) __notPaused public {
        require(Repository.isExistsCurrency(_currency));

        super.approve(address(Auction), _cardId);
        Auction.createAuction(msg.sender, _currency, _cardId, _startPrice, _endPrice, _duration);
        emit CreatAuction(msg.sender, _currency, _cardId, _startPrice, _endPrice, _duration);
    }

    function cancelAuction(uint256 _cardId) __notPaused public {

        Auction.cancelAuction(msg.sender, _cardId);
        super.safeTransferFrom(address(Auction), msg.sender, _cardId);
        emit CancelAuction(msg.sender, _cardId);
    }

    //TODO: player'in datasina ekleme + guvenlik.
    function bid(uint256 _cardId) __notPaused public payable {

        uint256 price; 
        uint256 currency; 
        uint256 discount; 
        address cardOwner;

        (cardOwner, price, currency) = Auction.getAuctionInfoForBid(_cardId);

        discount = Settings.getBidDiscountPercent();
        require(discount <= MAX_BID_CUT_OF_PERCENT);
        discount = price.mul(discount).div(10000);

        if(currency == uint256(CurrencyType.AVAX)) {            
            require (price <= msg.value);
            //deposit avax
            require(address(Repository).call.value(discount)());
            require(cardOwner.call.value(price - discount)());

            //its ok. in this scope "value - budget" never be negative.
            //msg.sender.transfer(msg.value - _budget);
            if(price < msg.value) {
                require(msg.sender.call.value(msg.value - price)());
            }            
        } else if (currency == uint256(CurrencyType.FODR)) {
            Repository.depositToken(msg.sender, currency, discount);
            Repository.transferFrom(msg.sender, cardOwner, currency, price - discount);
            msg.sender.transfer(msg.value);
        }

        Auction.bid(msg.sender, _cardId);
        super.safeTransferFrom( address(Auction), msg.sender, _cardId);
        emit Bid(cardOwner, msg.sender, _cardId, price, currency);
    }

    function getTokenAllowance(uint256 _currency) public view returns(uint256) {
        require(Repository.isExistsCurrency(_currency));
        Repository.getTokenAllowance(msg.sender, _currency);
    }

    function getCardInfo(uint256 _cardId) public view returns(uint256) {
        return Card.getCardInfo(_cardId);
    }

}
